import React from "react";
import { LinearScale, CategoryScale, LineElement, Chart, PointElement, BarElement, ArcElement } from "chart.js";
import { Bar, Doughnut, Line, Pie } from "react-chartjs-2";
import "./style/CustomChart.sass";
Chart.register(LinearScale, CategoryScale, LineElement, PointElement, BarElement, ArcElement);

export const example = {
  labels: ["January", "February", "March", "April", "May"],
  datasets: [
    {
      label: "Sales Data",
      backgroundColor: ["rgba(75, 192, 192, 0.2)", "#f49090a1", "#2e99a099", "#018a00d9", "#e97123a1"],
      borderColor: "rgba(75, 192, 192, 1)",
      borderWidth: 1,
      data: [60, 59, 60, 55, 56],
    },
  ],
};

/**
 *@typedef {Object} ChartArgument
 *@property {String[]} labels
 *@property {[]} datasets
 *@property {String} title
 *@property {"line"|"doughnut"|"bar"|"pie"} type
 */

/**
 *
 * @param {ChartArgument} props
 * @returns
 */
const CustomChart = (props) => {
  const { labels, datasets, title, type } = props;
  const chartData = {
    labels: labels,
    datasets: datasets,
  };

  return (
    <div className="chart_container">
      <div className="title">{title}</div>
      {type === "line" && <Line data={example} />}
      {type === "doughnut" && <Doughnut data={example} />}
      {type === "bar" && <Bar data={example} />}
      {type === "pie" && <Pie data={example} />}
    </div>
  );
};

export default CustomChart;
